import React from 'react';

const AjouterStg = () => {
    return (
        <>
            <form>
                <fieldset>
                    <label> Image : </label>
                    <input  type='text' id="image"/><br/>
                    <label></label>
                    <input  type='text' id="nom"/><br/>
                    <label></label>
                    <input  type='text' id="prenom"/><br/>
                    <label></label>
                    <input  type='text' id="email"/><br/>
                </fieldset>
            </form>    
        </>
    );
}

export default AjouterStg;
